import React from "react";

const FilterBySpecies = (props) => {
  const handleChange = (event) => {
    props.handleFilter({
      value: event.target.value,
      key: "species",
    });
  };

  return (
    <>
      <label htmlFor="species">Filtrar por especie</label>
      <input
        type="text"
        // value={props.name}
        name="species"
        id="species"
        onChange={handleChange}
      />
    </>
  );
};
export default FilterBySpecies;
